import React from 'react';
import {Text, View,StyleSheet,ScrollView,SafeAreaView,Button} from 'react-native';
import Boards from '../components/Boards'
import AddBoards from '../Modals/AddBoard'
const handlebtnAddBoards=()=>{
    return(<AddBoards/>);
}

const ListBoard=()=>{
    return(
        <SafeAreaView style={styles.container}>
            <Button title="Add Board" onPress={handlebtnAddBoards}/>
            <ScrollView>
                <Boards/>
                <Boards/>
                <Boards/>
                <Boards/>
                <Boards/>
                <Boards/>
                <Boards/>
                <Boards/>
                <Boards/>
                <Boards/>
                <Boards/>
                <Boards/>
                <Boards/>
                <Boards/>
            </ScrollView>
        </SafeAreaView>
   );
}


const styles = StyleSheet.create({
    container:{
        flex: 1,
    },

});
export default ListBoard
